import React, { } from 'react';
import { Line } from 'react-chartjs-2';



function Lines({ labels, datas }) {
    console.log(111, datas)
    const colos = ['red', 'blue']


    const data = {
        labels,
        datasets: datas.map((it, index) => ({
            fill: false,
            backgroundColor: colos[index],
            borderColor: 'rgba(255, 99, 132, 0.2)',
            label: it.label,
            data: it.data,
        }))
    };


    const option= {
        scales: {
            y: {
                beginAtZero: true,
                max: 10
            }
        }
    };
    return (
        <Line data={data}
            options={option} />
    );
}

export default Lines;
